import fakeData from "./MOCK_DATA.json";
import * as React from "react";
import { useTable } from "react-table";
import EC2Dashboard from "./components/EC2_dashboard";

function App() {
  return (
    <div className="App">
      <h1 className="title">Active EC2 Instances</h1>
      <EC2Dashboard />
    </div>
  );
}
